class Ingreso extends Component{  
    constructor(props){
        super(props);
        this.state={
            click: false
        }
    }
    click(email,pass){
        this.setState({click: true})
        if (this.state.click===true){
            console.log(email+pass)
        }
    }
    
    render(){
        return(
            <div>
                <form>
                    Email: <input type='email' className="element" id='email' ></input><br/>
                    pass: <input type='password' className="element" id='pass' ></input><br/>
                </form>
                <button className="element" onClick={this.click(document.getElementById('email').value, this.click(document.getElementById('pass').value))}>Ingresar</button>
            </div>
        )
    }

    
}

export default Ingreso;
